import React from 'react';
import logo from './logo.svg';
import './App.css';
import HomeBody from './homepage';
import MovieList from './movies';

class Welcome extends React.Component {
  render() {
    return <h1>Movie Site</h1>;
  }
}

function App() {
  return (
    <div>
      <Welcome />
      <HomeBody />
      <MovieList />
    </div>
  );
}

export default App;
